import React from "react";
import ReactDOM from "react-dom";
import {yutuber,favp,my,myy,mys} from "./App";
ReactDOM.render(<>
<ol>
<li>shubham</li>
<li>{yutuber}</li>
<li>{favp}</li>
<li>{my()}</li>
<li>{myy()}</li>
<li>{mys()}</li>
</ol>
</>,
document.getElementById('root')
	);
